
import { register } from '../core.js';

const lookup = "";

const chunks = {
  "dashicons-01.svg": new URL("./dashicons-01.svg", import.meta.url).href,
  "dashicons-02.svg": new URL("./dashicons-02.svg", import.meta.url).href
};

register('dashicons', {
  lookup,
  chunks,
  baseUrl: import.meta.url
});
